import logo from './logo.svg';
import './App.css';
import React, { useEffect } from 'react';


function App() {

  useEffect(() => {
    const fetchData = async () => {
      const apiUrl = 'http://localhost:5000/YourController/NewGrid?width=5&height=5';
      const response = await fetch(apiUrl);

      if (response.ok) {
        const data = await response.json();
        console.log('Grid Data:', data);

        // Now you can work with the returned JSON data
        // For example, you can loop through rows and columns
        for (const key in data) {
          if (data.hasOwnProperty(key)) {
            const rowArray = data[key];
            console.log(`Row ${key}:`, rowArray);
          }
        }
      } else {
        console.error(`HTTP error! Status: ${response.status}`);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Mine Game</h1>
      </header>
      <body className="App-body">
        <p id="grid"></p>
      </body>
    </div>
  );
}

export default App;
